import {
  BrowserRouter as Router,
  Switch,
  Route,
  Redirect,
} from "react-router-dom";
import Login from "./paginas/login";
import Cadastro from "./paginas/cadastro";
import Demanda from "./paginas/demanda";
import Fornecedores from "./paginas/fornecedores";
import { AuthProvider } from "./contexto/AuthContext";
import { UseAuth } from "./contexto/AuthContext";

function AuthPath(props) {
  const { gravarUsuario } = UseAuth();

  return (
    <Route
      render={() =>
        gravarUsuario.token ? props.children : <Redirect to="/login" />
      }
    />
  );
}

function Rotas() {
  return (
    <AuthProvider>
      <Router>
        <Switch>
          <Route path="/login" component={Login} />
          <Route path="/cadastro" component={Cadastro} />
          <AuthPath>
            <Route exact path="/fornecedores" component={Demanda} />
            <Route path="/fornecedores/:id" component={Fornecedores} />
          </AuthPath>
        </Switch>
      </Router>
    </AuthProvider>
  );
}

export default Rotas;
